import React, { Component } from 'react';
import './form.css'

export class Form extends Component {
    constructor(){
        super();
        this.state = {
            userFirstName: '',
            userLastName: '',
            userPhoneNumber: null,
            userEmail: '',
            userUsername: '',
            userPassword: '',
            userPrice: 0,
            userRealtor: false
        }
    }
  render() {
      let { userFirstName, userLastName, userPhoneNumber, userEmail, userUsername, userPassword, userPrice, userRealtor} = this.state;
      console.log(userFirstName,  userLastName, userPhoneNumber, userEmail, userUsername, userPassword, userPrice, userRealtor)
    return (
      <div>
        <form className='register'>
            <h1>Create an account to get expert information on houses in the Pheonix area</h1>
            <label>First Name: </label>
            <input type="text"  onChange={(e) => {
                this.setState({
                    userFirstName: e.target.value
                })
            }}/>
            <label>Last Name: </label>
            <input type="text" onChange={(e) => {
                this.setState({
                    userLastName: e.target.value
                })
            }} />
            <label>Phone Number: </label>
            <input type="text"  onChange={(e) => {
                this.setState({
                    userPhoneNumber: e.target.value
                })
            }}/>
            <label>Email: </label>
            <input type="text" onChange={(e) => {
                this.setState({
                    userEmail: e.target.value
                })
            }} />
            <label>Username: </label>
            <input type="text" onChange={(e) => {
                this.setState({
                    userUsername: e.target.value
                })
            }}/>
            <label>Password: </label>
            <input type='password' onChange={(e) => {
                this.setState({
                    userPassword: e.target.value
                })
            }} />
            <label>Price Range</label>
            <select name='Price'>
                <option value="Less than $ 99,999"> Less than $ 99,999 </option>
                <option value="$ 100,000 - $ 199,999">$ 100,000 - $ 199,999 </option>
                <option value="$ 200,000 - $ 299,999">$ 200,000 - $ 299,999 </option>
                <option value="$ 300,000 - $ 399,999">$ 300,000 - $ 399,999 </option>
                <option value="$ 400,000 - $ 499,999">$ 400,000 - $ 499,999 </option>
                <option value="$ 500,000 - $ 599,999">$ 500,000 - $ 599,999 </option>
                <option value="$ 600,000 - $ 699,999">$ 600,000 - $ 699,999 </option>
                <option value="$ 700,000 - $ 799,999">$ 700,000 - $ 799,999 </option>
                <option value="$ 800,000 - $ 899,999">$ 800,000 - $ 899,999 </option>
                <option value="$ 900,000 - $ 999,999 ">$ 900,000 - $ 999,999 </option>
                <option value="+ $ 1,000,000"> + $ 1,000,000 </option>
            </select>
            <label>Are you working with a realtor?</label>
            <select name="realtor">
                <option value="true"> Yes </option>
                <option value="false"> No </option>
            </select>
            <input type='submit'/>
        </form>
      </div>
    )
  }
}

export default Form
